// Extract test cases from AI agent output
const aiOutput = $json.output;

// Safely extract test cases array
const testCases = aiOutput?.test_cases || [];

// Validate and map to Google Sheets format
if (!Array.isArray(testCases) || testCases.length === 0) {
  console.log('No test cases generated');
  return [];
}

// Transform to structured output
return testCases.map(tc => ({
  json: {
    title: tc.title || 'Untitled Test Case',
    steps: tc.steps || 'No steps provided'
  }
}));

